showAllItems();const contactDiv=document.getElementById("contacts");function showAllItems(){fetch("https://randomuser.me/api/?results=50").then(function(t){return t.json()}).then(function(t){console.log(t.results);for(let e=0;e<t.results.length;e++){const n=t.results[e],o="<a class='contact' onclick='toggle_visibility(`contactInfo_"+e+"`)' href=#>"+n.name.first+" "+n.name.last+"</a>";contactDiv.innerHTML+="<div id='contactInfo_"+e+"' class='contactInfo '> <a class='closeButton' href=# onclick='toggle_visibility(`contactInfo_"+e+"`)'>X</a><h1>"+n.name.first+" "+n.name.last+"</h1> <table><tr><th>Address</th><th>Phone number</th><th>Age</th></tr> <tr><td>"+n.location.street+"</td><td>"+n.phone+"</td><td>"+n.dob.age+"</td></tr></table><img src='"+n.picture.large+"'</div>",contactDiv.innerHTML+=o}})}function toggle_visibility(t){console.log(t),document.getElementsByClassName("contactInfo").visibility="hidden";var e=document.getElementById(t);"visible"==e.style.visibility?e.style.visibility="hidden":e.style.visibility="visible"}function toggleInfo(t){console.log(t);let e=document.getElementsByClassName("contactInfo_"+t);console.log("divToToggle: "+e)}